import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Button } from "@material-ui/core";
import HomeIcon from "@material-ui/icons/Home";

import { TextField } from "@material-ui/core";
import frutillas from "../frutillas.png";
//import medidas from "../medidas.png";

class ComidasView extends Component {
  state = {};
  render() {
    return (
      <div className="css-evaluacion">
        <Link to="/">
          <Button
            variant="contained"
            color="default"
            size="small"
            startIcon={<HomeIcon />}
          >
            Regresar
          </Button>
        </Link>
        <h1>{this.props.name}</h1>
        <form autoComplete="off" onSubmit={this.addData}>
          <table>
            <tr>
              <td>
                <tr>
                  <TextField
                    label="Litros de agua diario"
                    type="numeric"
                    keyboardType="numeric"
                    onChange={(e) => this.onChange(e)}
                    margin="normal"
                    variant="outlined"
                  />
                </tr>
                <tr>
                  <TextField
                    label="Almuerzo"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
                <tr></tr>
                <tr>
                  <TextField
                    label="Colación uno"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
                <tr>
                  <TextField
                    label="Comida"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
                <tr>
                  <TextField
                    label="Colación dos"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
                <tr>
                  <TextField
                    label="Cena"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
                <tr>
                  <TextField
                    label="Té o infusión"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
              </td>
              &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
              <td>
                <tr>
                  <img
                    src={frutillas}
                    className="App-logo"
                    alt="frutillas"
                  />
                </tr>
              </td>
              &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
              <td>
                {/* <tr>
                        <div className={classes.root}>
                          <Typography id="discrete-slider-always" gutterBottom>
                            Always visible
                          </Typography>
                          <Slider
                            defaultValue={80}
                            getAriaValueText={valuetext}
                            aria-labelledby="discrete-slider-always"
                            step={10}
                            marks={marks}
                            valueLabelDisplay="on"
                          />
                        </div>
                      </tr> */}
                <tr>
                  {/* <img src={medidas} className="App-logo" alt="medidas" /> */}
                </tr>
              </td>
            </tr>
          </table>
        </form>
      </div>
    );
  }
}

export default ComidasView;
